import { useState } from "react";
import "./Page3pop.css";

function Page3pop() {
  const [popUp, setPopup] = useState(false);
  const openpop = () => {
    setPopup(!popUp);
  };

  return (
    <div className="Apppop">
      <button onClick={openpop}> popUp </button>
      <div>
        <div className="main">
          <div className="popUp">
            <div className="popUp-header"></div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Page3pop;
